import React from 'react'
import { Icon, Label, Menu, Table } from 'semantic-ui-react'
import HeaderForm from './HeaderForm'

function TableForm ( props ) {

  return(
    <div>
      <Table celled>
        <HeaderForm props={props}/>
      </Table>
    </div>
  )
}

export default TableForm
